import React, { useState } from 'react';
import { View, Text, TextInput, Button, StyleSheet, ScrollView } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome'; 


const App = () => {
  const [nome, setNome] = useState('');
  const [genero, setGenero] = useState('');
  const [dataNascimento, setDataNascimento] = useState('');
  const [usuario, setUsuario] = useState('');
  const [senha, setSenha] = useState('');
  const [email, setEmail] = useState('');
  const [confirmarEmail, setConfirmarEmail] = useState('');
  const [cpf, setCpf] = useState('');
  const [idioma, setIdioma] = useState('');
  const [dados, setDados] = useState(null);

  const handleCadastro = () => {
    const dadosCadastro = {
      nome,
      genero,
      dataNascimento,
      usuario,
      senha,
      email,
      confirmarEmail,
      cpf,
      idioma,
    };
    setDados(dadosCadastro);
    console.log(dadosCadastro);
  };

  return (
    <ScrollView contentContainerStyle={styles.container}>
      <View style={styles.inputContainer}>
      <Icon name="envelope" size={24} color="gray" style={styles.icon} /> {/* Ícone de envelope */}
        <Text>Nome:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setNome(text)}
          value={nome}
        />

        <Text>Gênero:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setGenero(text)}
          value={genero}
        />

        <Text>Data de Nascimento:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setDataNascimento(text)}
          value={dataNascimento}
        />

        <Text>Usuário:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setUsuario(text)}
          value={usuario}
        />

        <Text>Senha:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setSenha(text)}
          value={senha}
          secureTextEntry={true}
        />

        <Text>E-mail:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setEmail(text)}
          value={email}
          keyboardType="email-address"
        />

        <Text>Confirme seu E-mail:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setConfirmarEmail(text)}
          value={confirmarEmail}
          keyboardType="email-address"
        />

        <Text>CPF:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setCpf(text)}
          value={cpf}
          keyboardType="numeric"
        />

        <Text>Idioma do Currículo:</Text>
        <TextInput
          style={styles.input}
          onChangeText={(text) => setIdioma(text)}
          value={idioma}
        />

        <Button title="CADASTRAR" onPress={handleCadastro} />
      </View>

      {dados && (
        <View style={styles.card}>
          <Text style={styles.cardTitle}>Dados informados:</Text>
          <Text>{`Nome: ${dados.nome}`}</Text>
          <Text>{`Gênero: ${dados.genero}`}</Text>
          <Text>{`Data de Nascimento: ${dados.dataNascimento}`}</Text>
          <Text>{`Usuário: ${dados.usuario}`}</Text>
          <Text>{`E-mail: ${dados.email}`}</Text>
          <Text>{`CPF: ${dados.cpf}`}</Text>
          <Text>{`Idioma do Currículo: ${dados.idioma}`}</Text>
        </View>
      )}
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
    justifyContent: 'center',
    backgroundColor: '#f0f0f0',
  },
  inputContainer: {
    backgroundColor: '#fff',
    padding: 20,
    borderRadius: 10,
    elevation: 3,
    marginBottom: 20,
  },
  input: {
    height: 40,
    borderColor: 'gray',
    borderWidth: 1,
    marginBottom: 10,
  },
  card: {
    backgroundColor: '#fff',
    padding: 20,
    borderRadius: 10,
    elevation: 3,
  },
  cardTitle: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 10,
  },
});

export default App;
